import { Button } from 'antd';
import { getAllOrders } from '../../client';

const Home = async () => {
  try {
    const orders = await getAllOrders();
    console.log(orders);
  } catch (error) {
    console.error('Error fetching orders:', error);
  }

  return (
    <>
      <Button type="primary">Primary Button</Button>
    </>
  );
};

export default Home;
